import React from "react";
import "../input.css"; // 确保引入了 Tailwind CSS

function Home() {
  return (
    <div className=" flex justify-center items-center h-screen w-screen bg-white">
      <div className=" w-2/3 bg-white h-2/3  grid grid-cols-2 gap-4 ">
        <div className="border-2 w-full h-full">sssssss</div>
        <div className="border-2 w-full h-full">Coming Soon!</div>
      </div>
    </div>
  );
}

export default Home;
